import Navbar from './components/layout/Navbar'
import './App.css';

class App extends React.Component {
  // create a method as part of class

  foo = () => 'Bar';

  render(){
    return (
      <div className = 'App'>
        <Navbar title="GitHub Finder" icon='fab fa-github'/>
      </div>
    );
  }
}

export default App;
